import { Modal, Form, Input, Button, Space, Select, TimePicker, Row, Col, Tag, InputNumber } from 'antd';
import React, { useState, useEffect } from 'react';


const LoginPopUp = (props) => {

    const visible = props;

    //const [loading, setLoading] = useState(false);
 

 

  handleOk = () => {
    //setLoading(true);
    setTimeout(() => {
        //setLoading(false);
        //setVisible(false);
      //this.setState({ loading: false, visible: false });
    }, 3000);
  };

  handleCancel = () => {
    //this.setState({ visible: false });
  };

    return (
      <>
        
        
        
        <Modal
          visible={visible}
          title="Title"
          onOk={handleOk}
          onCancel={handleCancel}
          footer={[
            <Button key="back" onClick={handleCancel}>
              Return
            </Button>,
            <Button key="submit" type="primary" /*loading={loading}*/ onClick={handleOk}>
              Submit
            </Button>,
            <Button
              key="link"
              href="https://google.com"
              type="primary"
              //loading={loading}
              onClick={handleOk}
            >
              Search on Google
            </Button>,
          ]}
        >
          <p>Some contents...</p>
          <p>Some contents...</p>
          <p>Some contents...</p>
          <p>Some contents...</p>
          <p>Some contents...</p>
        </Modal>
      </>
    );
  }


export default LoginPopUp;
